(1401, 233, 'about_nise_home_contents', '[:en]To establish itself by -2030 as one of the world’s leading Institute in the field of Solar Energy through Research &amp; Development, Testing, Certification and Evaluation, Economics and Policy Planning, to emerge as a centre committed to the development, utilization and demonstration of solar energy related[:]'),
(1402, 233, '_about_nise_home_contents', 'field_592d39825d13e'),
(1403, 16, 'about_nise_home_contents', '[:en]National Institute of Solar Energy, an autonomous institution of Ministry of New and Renewable (MNRE), is the apex National R&D institution in the field Solar Energy. The Government of India has converted 25 year old Solar Energy Centre (SEC) under MNRE to an autonomous institution in September, 2013 to assist the Ministry in[:HI]अनुसंधान एवं विकास, परीक्षण, प्रमाणन और मूल्यांकन, अर्थशास्त्र और नीति नियोजन के माध्यम से सौर ऊर्जा के क्षेत्र में दुनिया के अग्रणी संस्थानों में से एक के रूप में - 2030 तक खुद को स्थापित करने के लिए, विकास के लिए प्रतिबद्ध केंद्र के रूप में उभरने, उपयोग और सौर का प्रदर्शन ऊर्जा संबंधित[:]'),
(1404, 16, '_about_nise_home_contents', 'field_592d39825d13e'),
