(1496, 244, 'director_message_home_contents', '[:en]NISE is an autonomous institute under Ministry of New and Renewable Energy, Government of India established to facilitate the Research &amp; Development, Testing, Certification, Skill Development activities in the field of Solar energy technologies. NISE also supports the ministry in the implementation[:HI]एनआईएसई नई ऊर्जा और नवीकरणीय ऊर्जा मंत्रालय, भारत सरकार द्वारा सौर ऊर्जा प्रौद्योगिकियों के क्षेत्र में अनुसंधान एवं विकास, परीक्षण, प्रमाणन, कौशल विकास गतिविधियों की सुविधा के लिए स्थापित है। एनआईएसई भी कार्यान्वयन में मंत्रालय का समर्थन करता है[:]'),
