(1798, 302, 'director_message_home_contents', '[:en]NISE is an autonomous institute under Ministry of New and Renewable Energy, Government of India established to facilitate the Research &amp; Development, Testing, Certification, Skill Development activities in the field of Solar energy technologies. NISE also supports the ministry in the implementation[:HI]एनआईएसई नई ऊर्जा और नवीकरणीय ऊर्जा मंत्रालय, भारत सरकार द्वारा सौर ऊर्जा प्रौद्योगिकियों के क्षेत्र में अनुसंधान एवं विकास, परीक्षण, प्रमाणन, कौशल विकास गतिविधियों की सुविधा के लिए स्थापित है। एनआईएसई भी कार्यान्वयन में मंत्रालय का समर्थन करता है[:]'),
(1799, 302, '_director_message_home_contents', 'field_592d3fa2f14d1'),
(1800, 303, 'about_nise_home_contents', '[:en]National Institute of Solar Energy, an autonomous institution of Ministry of New and Renewable (MNRE), is the apex National R&amp;D institution in the field Solar Energy.[:HI]अनुसंधान एवं विकास, परीक्षण, प्रमाणन और मूल्यांकन, अर्थशास्त्र और नीति नियोजन के माध्यम से सौर ऊर्जा के क्षेत्र में दुनिया के अग्रणी संस्थानों में से एक के रूप में - 2030 तक खुद को स्थापित करने के लिए, विकास के लिए प्रतिबद्ध केंद्र के रूप में उभरने, उपयोग और सौर का प्रदर्शन ऊर्जा संबंधित[:]'),
(1801, 303, '_about_nise_home_contents', 'field_592d39825d13e'),
(1802, 304, 'about_nise_home_contents', '[:en]The Government of India has converted 25 year old Solar Energy Centre (SEC) under MNRE to an autonomous institution in September, 2013 to assist the Ministry in implementing the National Solar Mission and to coordinate research, technology and other related works.[:HI]अनुसंधान एवं विकास, परीक्षण, प्रमाणन और मूल्यांकन, अर्थशास्त्र और नीति नियोजन के माध्यम से सौर ऊर्जा के क्षेत्र में दुनिया के अग्रणी संस्थानों में से एक के रूप में - 2030 तक खुद को स्थापित करने के लिए, विकास के लिए प्रतिबद्ध केंद्र के रूप में उभरने, उपयोग और सौर का प्रदर्शन ऊर्जा संबंधित[:]'),
(1803, 304, '_about_nise_home_contents', 'field_592d39825d13e'),
(1804, 305, 'about_nise_home_contents', '[:en]National Institute of Solar Energy, an autonomous institution of Ministry of New and Renewable (MNRE), is the apex National R&D institution in the field Solar Energy. The Government of India has converted 25 year old Solar Energy Centre (SEC) under MNRE to an autonomous institution in September, 2013 to assist the Ministry in implementing the National Solar Mission and to coordinate research, technology and other related works.[:HI]अनुसंधान एवं विकास, परीक्षण, प्रमाणन और मूल्यांकन, अर्थशास्त्र और नीति नियोजन के माध्यम से सौर ऊर्जा के क्षेत्र में दुनिया के अग्रणी संस्थानों में से एक के रूप में - 2030 तक खुद को स्थापित करने के लिए, विकास के लिए प्रतिबद्ध केंद्र के रूप में उभरने, उपयोग और सौर का प्रदर्शन ऊर्जा संबंधित[:]'),
(1805, 305, '_about_nise_home_contents', 'field_592d39825d13e'),
